import { useEffect, useState } from "react"
import { useDispatch, useSelector } from "react-redux"
import { showNotification,setPageTitle } from "../features/common/headerSlice"
import TitleCard from "../components/Cards/TitleCard"
import moment from "moment"

const INITIAL_INTEGRATION_LIST = [
  { name: "اتوبوس زرد", icon: "https://wallpapercave.com/fuwp/uwp3714490.webp", isActive: true, description: "از اینجا می توانید اتوبوس را تایید یا رد کنید" },
  { name: "اتوبوس اسکانیا", icon: "https://portal.bazargah.com/UploadFiles/Editor/skaniacompress.jpg", isActive: true, description: "از اینجا می توانید اتوبوس را تایید یا رد کنید" },
  { name: "اتوبوس ولوو", icon: "https://keihansafar.com/RentMiddleBus/wp-content/uploads/2021/05/%D8%A7%D8%AA%D9%88%D8%A8%D9%88%D8%B3-%D9%88%D9%84%D9%88%D9%88.jpg", isActive: true, description: "از اینجا می توانید اتوبوس را تایید یا رد کنید" },
  {
    name: "اتوبوس مان", icon: "data:image/jpeg;base64,",
    isActive: true, description: "از اینجا می توانید اتوبوس را تایید یا رد کنید"
  },
  { name: "اتوبوس بنز", icon: "data:image/jpeg;base64,", isActive: true, description: "از اینجا می توانید اتوبوس را تایید یا رد کنید" },
  { name: "اتوبوس رنو", icon: "data:image/jpeg;base64,", isActive: true, description: "از اینجا می توانید اتوبوس را تایید یا رد کنید" },
]

function Buses() {

  const dispatch = useDispatch()
  useEffect(() => {
    dispatch(setPageTitle({ title: "تایید یا عدم تایید اتوبوس" }))
  }, [])


  const [integrationList, setIntegrationList] = useState(INITIAL_INTEGRATION_LIST)


  const updateIntegrationStatus = (index) => {
    let integration = integrationList[index]
    setIntegrationList(integrationList.map((i, k) => {
      if (k === index) return { ...i, isActive: !i.isActive }
      return i
    }))
    dispatch(showNotification({ message: `${integration.name} ${integration.isActive ? "رد شد" : "تایید شد"}`, status: 1 }))
  }


  return (
    <>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6 w-200">
        {
          integrationList.map((i, k) => {
            return (
              <TitleCard key={k} title={i.name} topMargin={"mt-2"}>

                <p className="flex flex-col">
                  <img alt="icon" src={i.icon} className="w-full h-35 inline-block ml-4" />
                  <span className="mt-4">{i.description}</span>
                </p>
                <div className="mt-6 mb-0 text-right">
                  <input type="checkbox" className="toggle toggle-success toggle-lg" checked={i.isActive} onChange={() => updateIntegrationStatus(k)} />
                </div>
              </TitleCard>
            )

          })
        }
      </div>
    </>
  )
}

export default Buses